      <div className="center">
        <input className="f4 pa2 center W-70" type="text" />
        <button className="grow dib white bg-light-purple f4 link ph5 pw2 W-30">
          Detect
        </button>
      </div>
    </div>
  );
};

export default ImageLinkForm;
